import React from 'react'
import {Link,Outlet} from'react-router-dom';
const ViewDashboard = ()=> {
    return(
    <div>
        <div>
            <ul className="cont">
                <li className="con"><Link to="/dashboard/view/viewcategories">View Categories</Link></li>
                <li className="con"><Link to="/dashboard/view/viewcategories">View Products</Link></li>
                <li className="con"><Link to="/dashboard/view/viewproducts">View SubProducts</Link></li>
            </ul>
        
        </div>
        <Outlet/>
    </div>
    );
    
}
export default ViewDashboard
